const e=JSON.parse('{"key":"v-80cde20c","path":"/posts/note/MySQL/%E5%9F%BA%E7%A1%80%E8%AF%AD%E6%B3%95/30.%E4%B8%B4%E6%97%B6%E8%A1%A8%E5%92%8C%E6%B4%BE%E7%94%9F%E8%A1%A8.html","title":"临时表和派生表","lang":"zh-CN","frontmatter":{"title":"临时表和派生表","author":{"name":"北斗星司"},"category":["数据库"],"tag":["MySQL"],"date":"2023-10-23T15:08:32.000Z","icon":"file","description":"临时表(temporary table) 简介 在MySQL中，临时表是一种特殊类型的表，它允许我们存储一个临时结果集，可以在单个会话中多次重用。 功能 1.当会话结束或连接终止时，MySQL会自动删除临时表。当不再使用临时表时，也可以使用drop table语句来显式删除。 2.一个临时表只能由创建它的客户机访问。不同的客户端可以创建具有相同名称的临时表，而不会导致错误，因为只有创建临时表的客户端才能看到它。但是，在同一个会话中，两个临时表不能重名。","head":[["meta",{"property":"og:url","content":"https://mtgd106.github.io/posts/note/MySQL/%E5%9F%BA%E7%A1%80%E8%AF%AD%E6%B3%95/30.%E4%B8%B4%E6%97%B6%E8%A1%A8%E5%92%8C%E6%B4%BE%E7%94%9F%E8%A1%A8.html"}],["meta",{"property":"og:site_name","content":"北斗星司"}],["meta",{"property":"og:title","content":"临时表和派生表"}],["meta",{"property":"og:description","content":"临时表(temporary table) 简介 在MySQL中，临时表是一种特殊类型的表，它允许我们存储一个临时结果集，可以在单个会话中多次重用。 功能 1.当会话结束或连接终止时，MySQL会自动删除临时表。当不再使用临时表时，也可以使用drop table语句来显式删除。 2.一个临时表只能由创建它的客户机访问。不同的客户端可以创建具有相同名称的临时表，而不会导致错误，因为只有创建临时表的客户端才能看到它。但是，在同一个会话中，两个临时表不能重名。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-11-06T06:59:59.000Z"}],["meta",{"property":"article:author","content":"北斗星司"}],["meta",{"property":"article:tag","content":"MySQL"}],["meta",{"property":"article:published_time","content":"2023-10-23T15:08:32.000Z"}],["meta",{"property":"article:modified_time","content":"2023-11-06T06:59:59.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"临时表和派生表\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-10-23T15:08:32.000Z\\",\\"dateModified\\":\\"2023-11-06T06:59:59.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"北斗星司\\"}]}"]]},"headers":[{"level":2,"title":"临时表(temporary table)","slug":"临时表-temporary-table","link":"#临时表-temporary-table","children":[{"level":3,"title":"简介","slug":"简介","link":"#简介","children":[]},{"level":3,"title":"功能","slug":"功能","link":"#功能","children":[]},{"level":3,"title":"使用","slug":"使用","link":"#使用","children":[]}]},{"level":2,"title":"派生表(derived table)","slug":"派生表-derived-table","link":"#派生表-derived-table","children":[]},{"level":2,"title":"区别","slug":"区别","link":"#区别","children":[]}],"git":{"createdTime":1699253999000,"updatedTime":1699253999000,"contributors":[{"name":"mtgd106","email":"1487722388@qq.com","commits":1}]},"readingTime":{"minutes":4.97,"words":993},"filePathRelative":"posts/note/MySQL/基础语法/30.临时表和派生表.md","localizedDate":"2023年10月23日","excerpt":"<!-- permalink: /MySQL/基础语法/临时表和派生表  -->\\n<h2> 临时表(temporary table)</h2>\\n<h3> 简介</h3>\\n<p>在MySQL中，临时表是一种特殊类型的表，它允许我们存储一个临时结果集，可以在单个会话中多次重用。</p>\\n<h3> 功能</h3>\\n<p>1.当会话结束或连接终止时，MySQL会自动删除临时表。当不再使用临时表时，也可以使用drop table语句来显式删除。</p>\\n<p>2.一个临时表只能由创建它的客户机访问。不同的客户端可以创建具有相同名称的临时表，而不会导致错误，因为只有创建临时表的客户端才能看到它。但是，<strong>在同一个会话中，两个临时表不能重名。</strong></p>","copyright":{"author":"北斗星司"},"autoDesc":true}');export{e as data};
